import React, { useState } from "react";
import LabelStyle1 from "../components/custom controls/labels/LabelStyle1";
import TextBoxStyle2 from "../components/custom controls/textBox/TextBoxStyle2";
import ButtonStyle1 from "../components/custom controls/buttons/ButtonStyle1";
import ComboBoxStyle1 from "./custom controls/combo box/ComboBoxStyle1";
import GoogleIcon from "../Images/GoogleIcon.png";
import Login_SingUp_bg from "../Images/Login_SingUp_bg.png";

export default function SingUp({ SingInButtonHandled }) {
  const SingUpButtonHandled = () => {
    alert("wsh moooooh!");
  };

  const facultyOptions = [
    { value: 'option1', label: 'Informatique' },
    { value: 'option2', label: 'Math' },
    { value: 'option3', label: 'Physique' },
  ];

  const specialityOptions = [
    { value: 'option1', label: 'Isil' },
    { value: 'option2', label: 'Si' },
  ];

  const academicYear = [
    { value: 'option1', label: 'Licence 1' },
    { value: 'option2', label: 'Licence 2' },
    { value: 'option3', label: 'Licence 3' },
    { value: 'option4', label: 'Master 1' },
    { value: 'option5', label: 'Master 2' },
  ];

  const [selectedValue, setSelectedValue] = useState('');
  
  const handleSelectChange = (event) => {
    setSelectedValue(event.target.value);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSingUpFormData((prevData) => ({
      ...prevData,
      [name]: value
    }));
  };

  const [loginFormData, setSingUpFormData] = useState({
    email: '',
    password: ''
  });

  return (
    <div className="flex flex-col items-center w-full h-full p-6 bg-white rounded-lg shadow-md">
      <LabelStyle1 labelText="Sign Up" labelClassName="text-3xl mb-6 text-blue-600" />
      <form className="flex flex-col w-full">
        <div className="space-y-4">
          <div className="flex space-x-2">
            <div className="flex flex-col">
              <LabelStyle1 labelText="First Name:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='firstname' placeholder="First name" value={loginFormData.firstname} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
            <div className="flex flex-col">
              <LabelStyle1 labelText="Last Name:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='lastname' placeholder="Last name" value={loginFormData.lastname} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Matricule:" labelClassName="text-sm" />
            <TextBoxStyle2 Name='matricule' placeholder="222231354689" value={loginFormData.matricule} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Faculty:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="faculty" options={facultyOptions} value={selectedValue} onChange={handleSelectChange} comboBoxClassName="w-full border rounded-md shadow-sm" />
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Academic Year:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="academicYear" options={academicYear} value={selectedValue} onChange={handleSelectChange} />
            <LabelStyle1 labelText="Speciality:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="speciality" options={specialityOptions} value={selectedValue} onChange={handleSelectChange} />
          </div>

          <div className="flex space-x-1 bg-red-300">
            <LabelStyle1 labelText="Email:" labelClassName="text-md" />
            <TextBoxStyle2 Name='email' textBoxtype='email' placeholder="example@gmail.com" value={loginFormData.email} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
          </div>

          <div className="flex space-x-2">
            <div className="flex flex-col">
              <LabelStyle1 labelText="Password:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='password' type='password' placeholder="Password" value={loginFormData.password} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
            <div className="flex flex-col">
              <LabelStyle1 labelText="Confirm Password:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='confirmPassword' type='password' placeholder="Confirm password" value={loginFormData.confirmPassword} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
          </div>
        </div>

        <div className="mt-6">
          <ButtonStyle1 buttonText="Sign Up" buttonClassName="items-center w-full bg-blue-600 text-white rounded-md shadow-md hover:bg-blue-500 transition duration-200" onClick={SingUpButtonHandled} />
        </div>
      </form>

      <p className="text-gray-400 text-xs mt-4">
        Already have an account? 
        <button onClick={SingInButtonHandled} className="text-blue-400 hover:underline"> Sign In</button>
      </p>
    </div>
  );
}
